import React, { Component } from 'react'
import './Header.css'

class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      hovering : false
    }
  }

  render() {
    const style = {
      backgroundColor: this.state.hovering ? 'black' : undefined
    }

    const handleMouseEnter = () => this.setState({
      hovering: true
    })
    const handleMouseLeave = () => this.setState({
      hovering: false
    })

    return (
      <div
          style={style}
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
          id="header__body"
          className="glitch__header"
      >
        <h1 id='header__title1'
            className="back">Jeremy</h1>
        <br/>
        <h1 id='header__title2'
            className="middle">
          <span className='makes'>makes</span>
          <span className='breaks'>breaks</span>
        </h1>
        <br/>
        <h1 id='header__title3' className="front">stuff</h1>
        <div id="header__split1"></div>
        <div id="header__split2"></div>
      </div>
    )
  }
}

export default Header
